import styled from 'styled-components';



export const ContainerBg = styled.div`
    position: absolute;
    bottom: auto;
    width: 100%;
    height: 50;
    overflow: hidden;

`


export const FooterStyled = styled.div`
    width: 100%;
    height: 100px;
    padding: 10px 25px;
    bottom: auto;
    position:bottom;
    background-color:Black;
    z-index:100;
    font-size: 15px;
    color: White;
`
